script: |
  super -f text -I q12642.spq | sort > q12642.out

inputs:
  - name: q12642.spq
    data: |
      SELECT DISTINCT - 25 FROM tab0 (FORMAT parquet) AS cor0 WHERE + ( + 57 ) NOT BETWEEN + + col0 * + col1 + - col1 + + col0 * - - 66 AND - 23;
  - name: tab0

outputs:
  - name: q12642.out
    data: |
      -25
